import {Typography} from '@mui/material'

const AllDataComponent = () => {
  const dispatch = useDispatch();
  const  allVotersdata  = useSelector((state) => state.fetchAllVoters?.data);
  console.log("this is data in all voters componet ---->",allVotersdata);

  useEffect(() => {
    dispatch(fetchAllVotersAction());
    console.log('Im touched..!')
  }, [dispatch]);

  return (
    <>
    {allVotersdata.map((item) => {
      <Typography>{item}</Typography>
    })}
    </>
  );
};

export default AllDataComponent;
